import React, { Component } from 'react';
import { Link } from 'react-router-dom';
import axios from 'axios';

const Agreement = props => (
    <tr>
        <td>{props.Agreement.tenant}</td>
        <td>{props.Agreement.landlord}</td>
        <td>{props.Agreement.rent}</td>
        <td>{props.Agreement.address}</td>
        <td>
            <Link to={"/edit/"+props.agreement._id}>edit</Link> | <a href="#" onClick={() => { props.payRent(props.agreement._id) }}>Pay rent</a>
        </td>
    </tr>
)

export default class AgreementList extends Component {
    constructor(props) {
        super(props);

        this.payRent =  this.payRent.bind(this);

        this.state = {agreements: []};
    }

    componentDidMount() {
        axios.get('http://localhost:5000/agreement')
        .then(response => {
            this.setState({ agreements: response.data })
        })
        .catch((error) => {
            console.log(error);
        })
    }

    payRent(id) {
        axios.post('http://localhost:5000/agreement/update/' + id)
        .then(res => console.log(res.data));
        axios.get('http://localhost:5000/agreement')
        .then(response => {
            this.setState({ exercises: response.data })
        })
        .catch((error) => {
            console.log(error);
        });
    }

    agreementList() {
        return this.state.agreements.map(currentagreement => {
            return <Agreement agreement={currentagreement}  payRent={this.payRent} key={currentagreement._id}/>;
        })
    }

    render() {
        return (
            <div>
                <h3>Agreements</h3>
                <table className="table">
                    <thead className="thead-light">
                        <tr>
                            <th>Tenant</th>
                            <th>Landlord</th>
                            <th>Rent</th>
                            <th>Address</th>
                        </tr>
                    </thead>
                    <tbody>
                        { this.agreementList() }
                    </tbody>
                </table>
            </div>
        );
    }
}
